Happy Mother's Day to all of the beautiful, hard-working moms out there. While I'm not a mother of a physical child, I HAVE birthed a few of my dreams.....a few of my visions and small businesses. 

Say hello to my children. 

@forthefeminyou - a 501-C3 non-profit that focuses on creating safe spaces for womxn in small businesses and performing arts. EST. 2019.

@buttahbabez - EST. 2014,  an all-natural and organic skincare line hand crafted with love. Shea based butters, scrubs, body washes, shampoos, and conditioners.... stay tuned for our big ten year- anniversary relaunch 2024...

@handmadeinrva - EST. 2016/2017 ->> I wanted to create safe spaces for black owned businesses to vend in Richmond Virginia because I didn't see it! I hit up @duronchavis
@3rd_galaxi_art
@canaribird83 to help me connect the dots, and here we are years later, and there's a market EVERY weekend in Richmond Virginia for artists in every category. We set the bar on multiple levels and created a database of over 1,000 small businesses. 

@andreashopsforyou previously known as LA Dainta Vintage EST. 2011 has completely changed my life. Comprised of personal styling, Creative Direction, Event Curation, and Consulting, this is where my "art" really gets to flourish. I love connecting people, making folks feel confident in what they wear, and advising individuals/businesses on how to expand on their creativity and approach. Send a DM to book my services....

@dreasmusick est at birth. Singing, songwriting, hosting, and creating all types of music. New Music Drops this year...... stay tuned. If you know... you know. 

