Our First Annual Black And Free Kwanzaa Expo was an immense success. We collaborated with over 40 Black owned businesses, organizations, and performing artists to create this Oasis of black love and unity. On this last day of Kwanzaa, "Imani" (ee-MAH-nee) challenges people to believe in each other with all our hearts, and honor the righteousness and victory of their struggle. It is the profound and enduring belief in, and commitment to, family, community, people and culture.

We want to thank our core team who made this possible, but more importantly all of YOU, who truly embodied ALL 7 principles of KWANZAA in simply showing up with the energy we all needed. We're looking forward to next year's Black And Free Kwanzaa Expo, even bigger and better.

